import React from 'react'

const SearchBar = () => {
    return(
        <div style={searchbar_style}>
            <p>This is a test</p>
        </div>
    );
}

const searchbar_style = {
    height: "125px",
    width: "100%",
    position: "absolute",
    top: "8vh",
    zIndex: 3,
    backgroundColor: "black"
}

export default SearchBar
